Outrider is an album by Jimmy Page, released by Geffen Records on 19 June 1988. It is his first solo studio album and the first time since 1969 he has recorded with a record label other than Atlantic Records/Swan Song Records. Page recorded the music at his personal studio The Sol. Robert Plant guests on one track, &quot;The Only One&quot;, while John Bonham's son Jason drums with Page for the first time on record.

This was originally intended to be a two album release. However, during the early recording stages of this album, Page's house was broken into and amongst the items stolen were the demo tapes which had been recorded up to that point.[1] Page didn't record any demos prior to recording the album itself

